import React from "react";
import { Row } from "react-bootstrap";
import ListCategories from "./components/ListCategories";
import NavbarComponent from "./components/NavbarComponent";

function App() {
  return (
    <div className="App">
      <NavbarComponent />
      <Row>
        <ListCategories />
      </Row>
      <h2>Halo</h2>
    </div>
  );
}

export default App;
